<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title></title>
  <!-- <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;600&display=swap" rel="stylesheet" /> -->
<style>
* {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}
html, body {
  height: 100%;
  margin: 0;
}


body {
  font-family: 'Inter', sans-serif;
background: linear-gradient(135deg, #e3e3e3, #9b9090, #2d2828, #000000);
  color: #ddd;
  overflow-x: hidden;
  opacity: 0;
  animation: fadeIn 0.8s ease forwards;
}

@keyframes fadeIn {
  to { opacity: 1; }
}

jio {
  display: block;
  text-align: center;
  margin: 28px 0;
  font-size: 2.6rem;
  color: #eee;
  font-weight: 800;
  letter-spacing: 1px;
  text-shadow: 0 0 8px rgba(255, 255, 255, 0.2);
}

h1 {
  text-align: center;
  margin: 24px;
  font-size: 2.5rem;
  font-weight: 800;
  color: #ccc;
  text-shadow: 0 0 10px rgba(255, 255, 255, 0.15);
}

/* Loader */
.loader {
  position: fixed;
  top: 0; left: 0;
  width: 100%; height: 100%;
  background: rgba(10, 10, 10, 0.95);
  display: flex;
  align-items: center;
  justify-content: center;
  z-index: 9999;
}

.loader::after {
  content: "";
  width: 50px;
  height: 50px;
  border: 5px solid rgba(255, 255, 255, 0.15);
  border-top: 5px solid #999999;
  border-radius: 50%;
  animation: spin 0.9s linear infinite;
}

/* Search Bar */
.search-wrapper {
  display: flex;
  justify-content: center;
  padding: 0 16px;
  margin-bottom: 14px;
}

.search-wrapper input {
  width: 100%;
  max-width: 500px;
  padding: 14px 18px;
  font-size: 1rem;
  color: #eee;
  border-radius: 14px;
  border: 1px solid rgba(255, 255, 255, 0.1);
  outline: none;
  background: rgba(40, 40, 40, 0.75);
  backdrop-filter: blur(6px);
  transition: all 0.3s ease;
}

.search-wrapper input::placeholder {
  color: #bbb;
}

.search-wrapper input:focus {
  border-color: #bbb;
  box-shadow: 0 0 12px rgba(187, 187, 187, 0.5);
}

/* Grid */
.grid {
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(160px, 1fr));
  gap: 20px;
  padding: 16px;
}

@media (max-width: 600px) {
  .grid {
    grid-template-columns: repeat(2, 1fr);
  }
}

/* Cards */
.card {
  background: rgba(30, 30, 30, 0.8);
  backdrop-filter: blur(10px);
  border-radius: 18px;
  padding: 16px;
  text-align: center;
  transition: transform 0.3s ease, box-shadow 0.3s ease, background 0.3s ease;
  cursor: pointer;
  border: 1px solid rgba(200, 200, 200, 0.1);
  color: #eee;
}

.card:hover {
  transform: translateY(-6px) scale(1.05);
  background: linear-gradient(135deg, #555555, #888888, #444444);
  box-shadow: 0 12px 30px rgba(180, 180, 180, 0.5); /* bada, blur zyada, soft */
  border-color: #aaa;
}

.card:focus-within {
  outline: 2px solid #bbb;
}

.card img {
  max-width: 100%;
  height: 100px;
  object-fit: contain;
  margin-bottom: 12px;
  transition: transform 0.3s ease;
  filter: grayscale(0.2);
}

.card:hover img {
  transform: scale(1.08);
  filter: grayscale(0);
  /* subtle shadow glow */
  filter: drop-shadow(0 0 6px rgba(200, 200, 200, 0.4));
}

.card-title {
  font-size: 1.05rem;
  font-weight: 600;
  color: #eee;
  letter-spacing: 0.5px;
  text-shadow: 0 0 6px rgba(255, 255, 255, 0.15);
}

</style>

</head>

})();
